import React from "react";
import TransactionItem from "./TransactionItem";

export default () => {
  const transactions = [];

  const renderTransactions = () => {
    for (let i = 0; i < 10; i++) {
      transactions.push(
        <div>
          <TransactionItem />
        </div>
      );
    }

    return transactions;
  };

  return <div>{renderTransactions()}</div>;
};
